  (1, 'Dataturks', 'Dataturks', 0, 0, 0, 100, 1000000, 10, 1, '{\n  \"maxStringLengthForTextTasks\": \"800000\",\n \"fileUploadMaxSizeBytes\": \"1073741824\",\n \"maxHitsPerProject\": \"2000000\",\n \"numLabelsAllowed\": \"150000000\"\n}', NULL, '2018-03-01 15:44:30', '2018-08-11 09:16:10');
INSERT INTO `d_projects` (`id`, `name`, `orgId`, `accessType`, `taskType`, `taskRules`, `subtitle`, `description`, `shortDescription`, `status`, `totalStorageInMBs`, `labelsDone`, `validateWithGoldenHITs`, `minGoldenHITs`, `HITRepeatCount`, `notes`, `created_timestamp`, `updated_timestamp`)
VALUES
  ('2c9fafb062282fd801622ddbac320024', 'Demo POS Tagging Project', '2c9fafb061fa00c70161ff4dab0b002d', 'RESTRICTED', 'POS_TAGGING', '{\"tags\":\"Brand, ModelName, Category, ScreenSize, RAM, Storage, Price\",\"instructions\":\"Click on a word to select it, then click on the tag.\"}', NULL, '<div style=\"width:80%\">\n          <h1>Best Buy Search Queries NER Dataset</h1>\n\n          <p>A dataset containing actual search queries on bestBuy.com manually labled by human experts.</p>\n          \n          <p>The search queries have phrases labeled into various important entities like Brand, Model name, Category Name etc.\n             This dataset can be used as a training or evaluation set to build your own product search query understanding NLP solution.\n          </p>\n          \n          <p>Phrases in the queries are labeled by one of the below labels:\n            <ul class=\"bulleted list\">\n              <li>Category</li>\n              <li>Brand</li>\n              <li>ModelName</li>\n              <li>ScreenSize</li>\n              <li>RAM</li>\n              <li>Storage</li>\n              <li>Price</li>\n            </ul>\n          </p>\n          \n          <div class=\"marginTop\">\n            <p>The dataset can be used to build a named entity recognition system for Ecommerce or improving/evaluating product search systems.</p>\n            \n            <p>Below is the distribution of results and labels:</p>\n            <div class=\"marginTop\">\n                  <img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/dataturks/project_uploads/visualize1_small.png\" style=\"width:100%\"/>\n            </div>\n            <div class=\"marginTop\">\n                  <img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/dataturks/project_uploads/visualize2_small.png\" style=\"width:100%\"/>\n            </div>\n          </div>\n\n          <p>Key Features</p>\n\n          <ul class=\"bulleted list\">\n            <li>~1700 labeled named entity pairs</li>\n            <li>~1000 queries</li>\n            <li>7 Categories</li>\n            <li>Human labeled dataset</li>\n            <li>Queries taken from public apis</li>\n          </ul>\n\n</div>\n', 'Search queries and entities for an electronics ecommerce retailer', 'NONE', 0, 1808, 0, 0, 0, NULL, '2018-03-16 08:09:53', '2018-05-20 12:19:06'),
  ('2c9fafb062282fd801622de773dc0027', 'Demo Text Classification Project', '2c9fafb061fa00c70161ff4dab0b002d', 'RESTRICTED', 'TEXT_CLASSIFICATION', '{\"tags\":\"NO_GENRE_LISTED, Action, Adventure, Animation, Children, Comedy, Crime, Documentary, Drama, Fantasy, Film-Noir, Horror, IMAX, Musical, Mystery, Romance, Sci-Fi, Thriller, War, Western\",\"instructions\":\"Classify movies as per their theme\"}', NULL, '\n<div>\n          <h1>Movie genre classification. </h1>\n\n          <p>Manually curated dataset of movie names to movie genre classification. Movie names harvested from IMDB.</p>\n\n          <p>The tasks involves human moderators to label movie names by the genre of the movie (Each movie can be labeled in multiple classes):\n               <p>Movie names are classified into one of the below 19 classes:\n                <ul class=\"bulleted list\">\n                  <li>Action</li>\n                  <li>Adventure</li>\n                  <li>Adventure</li>\n                  <li>Children</li>\n                  <li>Comedy</li>\n                  <li>Crime</li>\n                  <li>Documentary</li>\n                  <li>Drama</li>\n                  <li>Fantasy</li>\n                  <li>Film-Noir</li>\n                  <li>Horror</li>\n                  <li>IMAX</li>\n                  <li>Musical</li>\n                  <li>Mystery</li>\n                  <li>Romance</li>\n                  <li>Sci-Fi</li>\n                  <li>Thriller</li>\n                  <li>War</li>\n                  <li>Western</li>\n                </ul>\n              </p>\n\n                <div class=\"marginTop\">\n                  <img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/dataturks/project_uploads/imdb_stats.png\" style=\"width:100%\"/>\n                </div>\n           </p>\n\n           <p>This dataset can be used as a golden set to build movie recommendation or clustering applications.  \n           \n           \n\n          <div class=\"marginTop\">\n            <p>Key Features</p>\n  \n            <ul class=\"bulleted list\">\n              <li>~1000 items</li>\n              <li>Human labeled dataset</li>\n              <li>19 classes</li>\n            </ul>\n          </div>\n\n</div>\n', 'IMDB Movie names classified into 19 genre.', 'NONE', 0, 471, 0, 0, 0, NULL, '2018-03-16 08:22:45', '2018-05-20 12:19:06'),
  ('2c9fafb062ca71c00162cdd45c8e0008', 'Demo Document Annotations', '2c9fafb061fa00c70161ff4dab0b002d', 'RESTRICTED', 'DOCUMENT_ANNOTATION', '{\"tags\":\"Name, Location, College, Skills, Education, Responsibility, Technology, Jobs, Companies, Roles, Others\",\"instructions\":\"Mark each phrase with the right label. When confusion between more than one label, mark the phrases with all the labels applicable.\",\"autoClose\":true}', 'Demo Document Annotations', '<div><h2>A document annotation dataset with 8 classes.</h2><p>The dataset has 526 items of which 76 items have been manually labeled.</p><p class=\"marginTop\"> The labels are divided into following 8 categories:<ul class=\"bulleted list\"><li>Skills</li><li> Education</li><li> Responsibility</li><li> Technology</li><li> Jobs</li><li> Companies</li><li> Roles</li><li> Others</li></ul></p><div class=\"marginTop\"><p>Key Features</p><ul class=\"bulleted list\"><li>526 items</li><li>8 categories</li><li>Human labeled dataset</li></ul></div></div>', 'A document annotation dataset with 8 classes for tagging documents/keywords from each of the categories and using it for multiple purposes like Resume summarization.', 'Manually', 0, 192, 0, 0, 0, NULL, '2018-04-16 09:41:09', '2018-07-04 06:10:13'),
  ('2c9fafb063a1ebf30163a7e3002b0035', 'Demo Image Classification Project', '2c9fafb061fa00c70161ff4dab0b002d', 'PUBLIC', 'IMAGE_CLASSIFICATION', '{\"tags\":\"Jeans, Jackets, Shirts, Skirts, Tops, Tshirts, Others\",\"instructions\":\"Mark the class of the garment.\",\"shortcuts\":{\"next\":{\"qualifier\":\"\",\"key\":\"right\"},\"previous\":{\"qualifier\":\"\",\"key\":\"left\"},\"Jeans\":{\"qualifier\":\"ctrl\",\"key\":\"j\"},\"Jackets\":{\"qualifier\":\"ctrl\",\"key\":\"a\"},\"Shirts\":{\"qualifier\":\"ctrl\",\"key\":\"s\"},\"Skirts\":{\"qualifier\":\"ctrl\",\"key\":\"k\"},\"Tops\":{\"qualifier\":\"ctrl\",\"key\":\"t\"},\"Tshirts\":{\"qualifier\":\"ctrl\",\"key\":\"r\"},\"Others\":{\"qualifier\":\"ctrl\",\"key\":\"o\"}}}', 'Image Classification for Ecommerce', '<div><h2>An image classification dataset with 7 classes.</h2><p>The dataset has 1933 items of which 412 items have been manually labeled.</p><p class=\"marginTop\"> The labels are divided into following 7 categories:<ul class=\"bulleted list\"><li>Jeans</li><li> Jackets</li><li> Shirts</li><li> Skirts</li><li> Tops</li><li> Tshirts</li><li> Others</li></ul></p><div class=\"marginTop\"><p>Key Features</p><ul class=\"bulleted list\"><li>1933 items</li><li>7 categories</li><li>Human labeled dataset</li></ul></div></div>', 'An Image classificaton dataset for Ecommerce Fashion category. The labels are divided into one of the 7 metioned categories.', 'Manually', 0, 72, 0, 0, 0, NULL, '2018-05-28 17:54:21', '2018-07-04 06:10:12'),
  ('2c9fafb0656f461b0165843201f200d2', 'Demo Image Bounding Box Project', '2c9fafb061fa00c70161ff4dab0b002d', 'RESTRICTED', 'IMAGE_POLYGON_BOUNDING_BOX_V2', '{\"tags\":\"face, car, airplane, person, tree, others\",\"instructions\":\"Click on a label on the right menu and then on the image click to mark left-top and right-bottom points to make a rectangle. \",\"defaultShape\":\"rectangle\"}', NULL, '<div><h2>An image bounding box dataset with 8 classes.</h2><p>The dataset has around 3000 items of which 100s of items have been manually labeled.</p><p class=\"marginTop\"> The labels are divided into following 4 categories:<ul class=\"bulleted list\"><li>Airplane</li><li> Face</li><li> Car</li><li> Others</li></ul></p><div class=\"marginTop\"><p>Key Features</p><ul class=\"bulleted list\"><li>3389 items</li><li>4 categories</li><li>Human labeled dataset</li></ul></div></div>', 'Images marked with bounding boxes as, Airplanes, Cars, Face etc.', 'Manually', 0, 744, 0, 0, 0, NULL, '2018-08-29 05:39:54', '2018-08-29 05:47:37'),
  ('2c9fafb0656f461b0165843c734c00d3', 'Demo Image Polygon Bounding Box', '2c9fafb061fa00c70161ff4dab0b002d', 'RESTRICTED', 'IMAGE_POLYGON_BOUNDING_BOX_V2', '{\"tags\":\"face, cars, person, airplane, person, tree, others\",\"instructions\":\"Click on a label on the right menu and then click on image to mark points of the polygon and finally click on the first point to close the Polygon.\",\"defaultShape\":\"polygon\"}', NULL, '<div><h2>An image polygon bounding box dataset with 5 classes.</h2><p>The dataset has around 3000 items of which 100s of items have been manually labeled.</p><p class=\"marginTop\"> The labels are divided into following 5 categories:<ul class=\"bulleted list\"><li>Airplane</li><li> Face</li><li> Person</li><li> Car</li><li> Others</li></ul></p><div class=\"marginTop\"><p>Key Features</p><ul class=\"bulleted list\"><li>1357 items</li><li>5 categories</li><li>Human labeled dataset</li></ul></div></div>', 'A dataset of polygons drawn on Airplanes, Faces, Cars, People etc.', 'Manually', 0, 73, 0, 0, 0, NULL, '2018-08-29 05:51:18', '2018-08-29 11:10:35'),
  ('2c9fafb0656f461b016589a1ccdf0125', 'Demo Video Classification', '2c9fafb061fa00c70161ff4dab0b002d', 'RESTRICTED', 'IMAGE_CLASSIFICATION', '{\"tags\":\"Street, Farm, Mountains, House, Car, Others\",\"instructions\":\"Look at the scene and select the class that applies.\"}', NULL, NULL, NULL, 'NONE', 0, 7, 0, 0, 0, NULL, '2018-08-30 07:00:07', '2018-10-05 06:10:10');
